import React from 'react';
import './../../node_modules/bootstrap/dist/css/bootstrap.min.css'

const Header = () => {
  return (
    <header>
        <div class="container-fluid">
            <div class="row pt-5">
                <div>
                    <button class="btn btn-success">Hello</button>
                </div>
            </div>
        </div>
    </header>
  );
};

export default Header;
